import { Button } from '@mui/material';
import React from 'react'
import ReactPlayer from 'react-player';
function Feed() {
    const [playing,setPlaying] = useState(true);
    const handlePlaying = () => {
        setPlaying(true);
    }
    return (
        <div className='flex flex-col w-full h-screen justify-center items-center mt-10'>
            <div>
                <Button variant='outlined'>Upload Video</Button>
            </div>
            <div className='flex justify-center items-center h-full'>
                <div className='height-[100%] width-[40%]'>
                    <ReactPlayer onClick = {handlePlaying} playing= {playing} width='40%'
                        loop={true} height='100%' url="http://commondatastorage.googleapis.com/gtv-videos-bucket/sample/ElephantsDream.mp4" controls={true}></ReactPlayer>
                </div>
                <div>
                    <span className="top-0 p-2 shadow-lg cursor-pointer shadow-grey-800 rounded-lg material-symbols-outlined">
                        arrow_upward
                    </span>
                    <span className="bottom-0 p-2 shadow-lg cursor-pointer shadow-grey-800 rounded-lg material-symbols-outlined">
                        arrow_downward
                    </span>
                </div>
            </div>
        </div>
    )
}

export default Feed
